import {BrowserRouter, Routes, Route} from 'react-router-dom';
import { Provider } from "react-redux";
import App from './App';


export const Root = ({store}) => (
    <Provider store={store}>
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<App />}>
                    <Route path=":filter" element={<App />} />
                </Route>
            </Routes>
        </BrowserRouter>
    </Provider>
);
